import React, { Component, PropTypes } from 'react';

import miniplayer from '../Miniplayer/Miniplayer.scss';
import mdm from './MiniplayerDropmenu.scss';

import { MiniplayerVolume, VolumeWrapper } from '../MiniplayerVolume/MiniplayerVolume';

class MiniPlayerVisual {

  constructor() {
    this.entinit = this.entinit.bind(this);
    this.fly = this.fly.bind(this);
    this.isCanvasSupported = this.isCanvasSupported.bind(this);
    this.setupRAF = this.setupRAF.bind(this);
    this.smoothTrail = this.smoothTrail.bind(this);
    this.initializeStars = this.initializeStars.bind(this);
    this.executeFrame = this.executeFrame.bind(this);
    this.stars = this.stars.bind(this);
    this.moveStars = this.moveStars.bind(this);
    this.drawStars = this.drawStars.bind(this);
    this.starsArray = [];
    this.Mceil = Math.ceil;
    this.a = [];
    this.asize = 40;
  }


  entinit(arr, where) {
    arr = { // eslint-disable-line no-param-reassign
      posX: where.canvas.width / 2,
      posY: where.canvas.height / 2,
      scale: 1.1,
      speedexp: Math.random() * 0.5 + 1.2, // eslint-disable-line no-mixed-operators
      angle: Math.random() * 2,
      img: this.Mceil(Math.random() * 6),
      skip: this.Mceil(Math.random() * 100),
    };
    arr.posX += Math.random() * (where.canvas.width / 4) // eslint-disable-line no-param-reassign
    * Math.cos(Math.PI * arr.angle); // eslint-disable-line no-param-reassign
    arr.posY += Math.random() * (where.canvas.height / 4) // eslint-disable-line no-param-reassign
    * Math.sin(Math.PI * arr.angle); // eslint-disable-line no-param-reassign
    return arr;
  }

  fly() {
    const Default = 'data:image/png;base64,';

    const l1 = new Image();
    const l2 = new Image();
    const l3 = new Image();
    const l4 = new Image();
    const l5 = new Image();
    const l6 = new Image();
    l1.src = Default;
    l2.src = Default;
    l3.src = Default;
    l4.src = Default;
    l5.src = Default;
    l6.src = Default;

    const ctx = document.getElementsByTagName('canvas')[0].getContext('2d');
    ctx.canvas.width = window.innerWidth;
    ctx.canvas.height = window.innerHeight;

    // ctx.canvas.width = ctx.canvas.width;
    for (let i = 0; i < this.asize; i++) { // eslint-disable-line no-plusplus
      if (this.a[i] === undefined) { this.a[i] = this.entinit(this.a[i], ctx); }
      if (this.a[i].skip <= 0) {
        let curimg = null;

        switch (this.a[i].img) {
          case 0:
          case 1:curimg = l1; break;
          case 2:curimg = l2; break;
          case 3:curimg = l3; break;
          case 4:curimg = l4; break;
          case 5:curimg = l5; break;
          case 6:curimg = l6; break;
          default: break;
        }

        this.a[i].scale = this.a[i].scale + this.a[i].speedexp / 4; // eslint-disable-line
        this.a[i].speedexp = 1.03 * Math.pow(this.a[i].speedexp, 1.02); // eslint-disable-line

        if (Math.cos(Math.PI * this.a[i].angle) < 0) {
          this.a[i].posX = this.a[i].posX -
          (Math.abs(this.a[i].speedexp * Math.cos(Math.PI * this.a[i].angle))); // eslint-disable-line
        } else {
          this.a[i].posX = this.a[i].posX + this.a[i].speedexp * Math.cos(Math.PI * this.a[i].angle); // eslint-disable-line
        }

        if (Math.sin(Math.PI * this.a[i].angle) < 0) { // eslint-disable-line
          this.a[i].posY = this.a[i].posY - (Math.abs(this.a[i].speedexp * Math.sin(Math.PI * this.a[i].angle))); // eslint-disable-line
        } else {
          this.a[i].posY = this.a[i].posY + this.a[i].speedexp * Math.sin(Math.PI * this.a[i].angle); // eslint-disable-line
        }

        if (this.a[i].posX + this.a[i].scale < 0 ||
          this.a[i].posX - this.a[i].scale > window.innerWidth ||
          this.a[i].posY + this.a[i].scale < 0 ||
          this.a[i].posY - this.a[i].scale > window.innerHeight) {
          this.a[i] = this.entinit(this.a[i], ctx);
        }

        ctx.drawImage(curimg,
          this.a[i].posX - this.a[i].scale / 2, // eslint-disable-line no-mixed-operators
          this.a[i].posY - this.a[i].scale / 2, // eslint-disable-line no-mixed-operators
          this.a[i].scale, this.a[i].scale);
      } else {
        this.a[i].skip = this.a[i].skip - 1;
      }
    }

    requestAnimationFrame(this.fly);
  }

  smoothTrail() {
    this.init = function () { // eslint-disable-line
      this.loop();
    };

    const _this = this; // eslint-disable-line
    this.c = document.getElementsByTagName('canvas')[0];
    this.ctx = document.getElementsByTagName('canvas')[0].getContext('2d');
    this.cw = window.innerWidth;
    this.ch = window.innerHeight;
    this.mx = 0;
    this.my = 0;

    // trail
    this.trail = [];
    this.maxTrail = 100;
    this.mouseDown = false;

    this.ctx.lineWidth = 0.1;
    this.ctx.lineJoin = 'round';

    this.radius = 1;
    this.speed = 0.4;
    this.angle = 0;
    this.arcx = 0;
    this.arcy = 0;
    this.growRadius = true;
    this.seconds = 0;
    this.milliseconds = 0;


    this.rand = function (rMi, rMa) { // eslint-disable-line
      return ~~((Math.random() * (rMa - rMi + 1)) + rMi); // eslint-disable-line
    };

    this.hitTest = function (x1, y1, w1, h1, x2, y2, w2, h2) { // eslint-disable-line
      return !(x1 + w1 < x2 || x2 + w2 < x1 || y1 + h1 < y2 || y2 + h2 < y1); // eslint-disable-line
    };

    this.createPoint = function (x, y) { // eslint-disable-line
      this.trail.push({
        x,
        y,
      });
    };

    this.updateTrail = function () { // eslint-disable-line
      if (this.trail.length < this.maxTrail) {
        this.createPoint(this.arcx, this.arcy);
      }

      if (this.trail.length >= this.maxTrail) {
        this.trail.splice(0, 1);
      }
    };

    this.updateArc = function () { // eslint-disable-line
      this.arcx = (this.cw / 2) + Math.sin(this.angle) * this.radius; // eslint-disable-line
      this.arcy = (this.ch / 2) + Math.cos(this.angle) * this.radius; // eslint-disable-line
      const d = new Date();
      this.seconds = d.getSeconds();
      this.milliseconds = d.getMilliseconds();
      this.angle += this.speed * (this.seconds + 1 + (this.milliseconds / 1000));

      if (this.radius <= 1) {
        this.growRadius = true;
      }
      if (this.radius >= 200) {
        this.growRadius = false;
      }

      if (this.growRadius) {
        this.radius += 1;
      } else {
        this.radius -= 1;
      }
    };

    this.renderTrail = function () { // eslint-disable-line
      let i = this.trail.length;

      this.ctx.beginPath();
      while (i--) { // eslint-disable-line no-plusplus
        const point = this.trail[i];
        const nextPoint = (i === this.trail.length) ? this.trail[i + 1] : this.trail[i];

        const c = (point.x + nextPoint.x) / 2;
        const d = (point.y + nextPoint.y) / 2;
        this.ctx.quadraticCurveTo(Math.round(this.arcx), Math.round(this.arcy), c, d);
      }

      this.ctx.strokeStyle = `hsla(${this.rand(170, 300)}, 100%, ${this.rand(50, 75)}%, 1)`;
      this.ctx.stroke();
      this.ctx.closePath();
    };

    this.clearCanvas = function () { // eslint-disable-line
      this.ctx.globalCompositeOperation = 'destination-out';
      this.ctx.fillStyle = 'rgba(0,0,0,.1)';
      this.ctx.fillRect(0, 0, this.cw, this.ch);
      this.ctx.globalCompositeOperation = 'lighter';
    };

    this.loop = function () { // eslint-disable-line
      const loopIt = function () { // eslint-disable-line
        requestAnimationFrame(loopIt, _this.c);
        _this.clearCanvas();
        _this.updateArc();
        _this.updateTrail();
        _this.renderTrail();
      };
      loopIt();
    };
  }


  isCanvasSupported = () => {
    const elem = document.createElement('canvas');
    return !!(elem.getContext && elem.getContext('2d'));
  }

  setupRAF = () => {
    let lastTime = 0;
    const vendors = ['ms', 'moz', 'webkit', 'o'];
    for (let x = 0; x < vendors.length && !window.requestAnimationFrame; ++x) { // eslint-disable-line
      window.requestAnimationFrame = window[`${vendors[x]}RequestAnimationFrame`];
      window.cancelAnimationFrame = window[`${vendors[x]}CancelAnimationFrame`] || window[`${vendors[x]}CancelRequestAnimationFrame`];
    }

    if (!window.requestAnimationFrame) {
      window.requestAnimationFrame = function (callback, element) { // eslint-disable-line
        const currTime = new Date().getTime();
        const timeToCall = Math.max(0, 16 - (currTime - lastTime));
        const id = window.setTimeout(() => {
          callback(currTime + timeToCall);
        }, timeToCall);
        lastTime = currTime + timeToCall;
        return id;
      };
    }

    if (!window.cancelAnimationFrame) {
      window.cancelAnimationFrame = function (id) { // eslint-disable-line
        clearTimeout(id);
      };
    }
  }

  executeFrame = (animate) => {
    if (animate) {
      requestAnimFrame(this.executeFrame); // eslint-disable-line
    }
    this.moveStars();
    this.drawStars();
  }

  initializeStars = () => {
    const canvas = document.getElementsByTagName('canvas')[0];
    const numStars = 1900;
    let i = 0;
    while (i < numStars) {
      const star = {
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        z: Math.random() * canvas.width,
        o: `0.${Math.floor(Math.random() * 99)}${1}`, // eslint-disable-line
      };
      this.starsArray.push(star);
      i++; // eslint-disable-line no-plusplus
    }
  }

  moveStars = () => {
    let i = 0;
    const numStars = 1900;
    const canvas = document.getElementsByTagName('canvas')[0];
    while (i < numStars) {
      const star = this.starsArray[i];
      star.z--; // eslint-disable-line no-plusplus
      if (star.z <= 0) {
        star.z = canvas.width;
      }
      i++; // eslint-disable-line no-plusplus
    }
  }

  drawStars = () => {
    let pixelX;
    let pixelY;
    let pixelRadius;
    const canvas = document.getElementsByTagName('canvas')[0];
    const numStars = 1900;
    const centerX = canvas.width / 2;
    const centerY = canvas.height / 2;
    const radius = `0.${Math.floor(Math.random() * 9)}${1}`;
    const focalLength = canvas.width * 2;
    const warp = 0;
    const c = canvas.getContext('2d');

    if ((canvas.width !== window.innerWidth) || (canvas.width !== window.innerWidth)) {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
      this.initializeStars();
    }

    if (warp === 0) {
      // we want to use css as our fill
      c.globalCompositeOperation = 'destination-out';
      c.fillStyle = 'rgba(0,0,0,1)';
      c.fillRect(0, 0, canvas.width, canvas.height);
    }

    c.fillStyle = `rgba(209, 255, 255, ${radius})`;
    let i = 0;

    while (i < numStars) {
      const star = this.starsArray[i];
      pixelX = ((star.x - centerX) * focalLength) / star.z;
      pixelX += centerX;
      pixelY = ((star.y - centerY) * focalLength) / star.z;
      pixelY += centerY;
      pixelRadius = (1 * focalLength) / star.z;
      c.fillRect(pixelX, pixelY, pixelRadius, pixelRadius);
      c.fillStyle = `rgba(209, 255, 255, ${star.o})`;
      c.globalCompositeOperation = 'source-over';
      i++; // eslint-disable-line
    }
  }

  stars = () => {
    window.requestAnimFrame = (() => window.requestAnimationFrame)();
    const canvas = document.getElementsByTagName('canvas')[0]; // eslint-disable-line no-unused-vars
    const animate = !!1;
    this.initializeStars();
    this.executeFrame(animate);
  }
}

class Dropdown extends Component {
  static propTypes = {
    onVoid: PropTypes.func,
    onReveal: PropTypes.func,
    actions: PropTypes.func,
    volume: PropTypes.number,
    menu: PropTypes.array, // eslint-disable-line
  }

  static defaultProps = {
    onVoid: null,
    onReveal: null,
    actions: null,
    volume: 100,
    menu: !1,
  }

  constructor(props) {
    super(props);

    this.state = {
      menuShown: !1,
      isOnTop: !1,
      isVisual: !1,
    };

    this.grap = this.grap.bind(this);
    this.hasClass = this.hasClass.bind(this);
    this.clickOutside = this.clickOutside.bind(this);
    this.checkStatus = this.checkStatus.bind(this);
    this.isAlways = this.isAlways.bind(this);
    this.Visual = this.Visual.bind(this);
    this.setActiveState = this.setActiveState.bind(this);
    this.display = this.display.bind(this);
    this.void = this.void.bind(this);
    this.reveal = this.reveal.bind(this);
    this.DockMiniPlayer = this.DockMiniPlayer.bind(this);
    this.conceal = this.conceal.bind(this);
    this.renderMenuShown = this.renderMenuShown.bind(this);
  }

  setActiveState = (e) => {
    const { actions } = this.props; // eslint-disable-line react/prop-types
    actions('DockActive', this.state.isOnTop, { visual: { state: this.state.isVisual, class: mdm.on } });

    // only allow to toggle our randomVisual if we are clicking on our visual with state !!1
    if (e.target.nodeName === 'LABEL' && this.hasClass(e.target.parentNode, 'visual')) {
      const canvas = document.getElementsByTagName('canvas')[0];
      const context = canvas.getContext('2d');

      if (this.state.isVisual) {
        const visual = new MiniPlayerVisual();

        const randomVisual = (where) => {
          // clear for re-drawing
          context.save();
          context.setTransform(1, 0, 0, 1, 0, 0);
          context.clearRect(0, 0, canvas.width, canvas.height);
          context.restore();

          const visuals = [
            function () { // eslint-disable-line
              where.stars();
            },
            function () { // eslint-disable-line
              const cl = new where.smoothTrail(); // eslint-disable-line
              where.setupRAF();
              cl.init();
            },
            function () { // eslint-disable-line
              where.fly();
            },
          ];

          const generate = visuals[Math.floor(Math.random() * visuals.length)];
          return generate.call();
        };

        randomVisual(visual); // eslint-disable-line
      } else {
        // clear for re-drawing
        context.save();
        context.setTransform(1, 0, 0, 1, 0, 0);
        context.clearRect(0, 0, canvas.width, canvas.height);
        context.restore();
      }
    }
  }

  grap = (item) => {
    // console.log(this);
    this.grapped = item;
  }

  hasClass = (e, c) => e.classList.contains(c)

  clickOutside = (e) => { // eslint-disable-line
    // console.log(e.target);
    if ((this.hasClass(e.target, miniplayer.flex) || this.hasClass(e.target, miniplayer.pos_rel) || this.hasClass(e.target.parentNode, miniplayer.menu_vol) || this.hasClass(e.target, 'svg') || this.hasClass(e.target, 'rp_selected'))) {
      this.setState({ menuShown: !1 });
    }
  }

  checkStatus = () => {
    const active = this.hasClass(window.document.querySelector('body'), 'drag');
    const normT = window.document.querySelector("[class*='Miniplayer__open']");
    const norm = window.document.querySelector("[class*='Miniplayer__open'] path");

    const stas = window.document.querySelector("[class*='Miniplayer__cB']");

    if (!active) {
      norm.setAttribute('d', 'M19,4H5C3.9,4,3,4.9,3,6v12c0,1.1,0.9,2,2,2h4v-2H5V8h14v10h-4v2h4c1.1,0,2-0.9,2-2V6C21,4.9,20.1,4,19,4z M12,20l4-4h-3 v-6h-2v6H8L12,20z');
      normT.setAttribute('title', 'MiniPlayer is Docked');
      stas.setAttribute('disabled', !!1);
      stas.setAttribute('title', "Can't toggle in a docked state");
    } else {
      norm.setAttribute('d', 'M19 4H5c-1.11 0-2 .9-2 2v12c0 1.1.89 2 2 2h4v-2H5V8h14v10h-4v2h4c1.1 0 2-.9 2-2V6c0-1.1-.89-2-2-2zm-7 6l-4 4h3v6h2v-6h3l-4-4z'); // eslint-disable-line
      normT.setAttribute('title', 'MiniPlayer is UnDocked');
      stas.setAttribute('disabled', !1);
      stas.setAttribute('title', 'Toggle Always on top');
    }
  }

  isAlways = () => {
    const active = this.hasClass(window.document.querySelector('body'), 'drag');

    if (document.querySelector("[class*='Miniplayer__cB']").attributes.disabled.value = 'false') { // eslint-disable-line
      if (active) {
        document.querySelector("[class*='Miniplayer__cB']").classList.toggle(mdm.on);
      }
    }

    const toggle = this.hasClass(document.querySelector("[class*='Miniplayer__cB']"), mdm.on);

    if (toggle) {
      this.setState({ isOnTop: !!1 });
    } else {
      this.setState({ isOnTop: !1 });
    }
  }

  Visual = () => {
    const active = this.hasClass(window.document.querySelector('body'), 'drag');

    if (document.querySelector("[class*='Miniplayer__cB']").attributes.disabled.value = 'false') { // eslint-disable-line
      if (active) {
        document.querySelector("[class*='visual']").classList.toggle(mdm.on);
      }
    }

    const toggle = this.hasClass(document.querySelector("[class*='visual']"), mdm.on);

    const canvas = document.querySelector('canvas');

    if (toggle) {
      this.setState({ isVisual: !!1 });
      canvas.classList.add('visible');
    } else {
      this.setState({ isVisual: !1 });
      canvas.classList.remove('visible');
    }
  }

  reveal = (e) => {
    this.setState({ menuShown: !!1 });
    if (this.props.onReveal) { this.props.onReveal(e); } // eslint-disable-line
  }

  void = (e) => {
    this.setState({ menuShown: !1 });
    if (this.props.onVoid) { this.props.onVoid(e); } // eslint-disable-line
  }

  display = (e) => {
    e.preventDefault();
    e.stopPropagation();
    this.conceal();
  }

  DockMiniPlayer = () => {
    const { actions, volume } = this.props;
    actions('DockMiniPlayer', { volume: { state: volume } });

    if (this.state.menuShown) {
      this.setState({ menuShown: !1 }); // make sure we reset
    }
  }

  conceal = (e) => {
    if (this.state.menuShown) {
      this.void(e);
    } else {
      this.reveal(e);
    }
  }

  renderMenuShown = () => {
    const I = [];
    for (let c = 0; c < this.props.menu.length; c++) { // eslint-disable-line
      const i = this.props.menu[c];

      let p;

      if (i.checkbox) {
        if (i.name === 'Always on top') {
          p = <span className={mdm.cB}><div title="Can't toggle in a docked state" className={miniplayer.cB} onClick={this.isAlways} disabled><label /></div>{i.name}</span>; // eslint-disable-line
        }

        if (i.name === 'Visualization') {
          p = <span className={mdm.cB}><div title="Toggle Visualization" className={`${miniplayer.cB} visual`} onClick={this.Visual} disabled><label /></div>{i.name}</span>; // eslint-disable-line
        }
      } else {
        p = <span>{i.name}</span>;
      }

      I.push(<div // eslint-disable-line
        key={c}
        onClick={ // eslint-disable-line
          this.grap.bind(null, i) // eslint-disable-line
        } // eslint-disable-line
      >
        {p}
      </div>);
    }
    return I;
  }

  renderDockButton = () => (
    <svg className="svg" viewBox="0 0 24 24" preserveAspectRatio="xMidYMid meet"><g><path d="M19,4H5C3.9,4,3,4.9,3,6v12c0,1.1,0.9,2,2,2h4v-2H5V8h14v10h-4v2h4c1.1,0,2-0.9,2-2V6C21,4.9,20.1,4,19,4z M12,20l4-4h-3 v-6h-2v6H8L12,20z" /></g></svg>
    )

  render() {
    document.addEventListener('click', this.clickOutside, false);
    window.addEventListener('load', this.checkStatus, false);
    window.addEventListener('click', this.setActiveState, false);

        // is window not focused ?
    window.onblur = () => {
      this.setState({ menuShown: !1 });
      window.document.querySelector('body').classList.remove(miniplayer.noD);
      window.document.querySelector('.volume').classList.remove('volume__active');
    };

    const { actions, volume } = this.props;

    return (<section>

      <VolumeWrapper>
        <MiniplayerVolume
          actions={actions} volume={volume} trigger={<playerbutton className={`${miniplayer.bput} ${miniplayer.shadow} ${miniplayer.menu_vol}`}>
            <svg className="svg" viewBox="0 0 24 24" preserveAspectRatio="xMidYMid meet"><g><path d="M3 9v6h4l5 5V4L7 9H3zm13.5 3c0-1.77-1.02-3.29-2.5-4.03v8.05c1.48-.73 2.5-2.25 2.5-4.02zM14 3.23v2.06c2.89.86 5 3.54 5 6.71s-2.11 5.85-5 6.71v2.06c4.01-.91 7-4.49 7-8.77s-2.99-7.86-7-8.77z" /></g></svg>
          </playerbutton>} position="bottom"
        >
                    slider here
                </MiniplayerVolume>
      </VolumeWrapper>

      <playerbutton title="MiniPlayer is Docked" className={`${miniplayer.bput} ${miniplayer.shadow} ${miniplayer.open}`} onClick={this.DockMiniPlayer}>
        {this.renderDockButton()}
      </playerbutton>

      <playerbutton className={`${miniplayer.bput} ${miniplayer.shadow} ${miniplayer.menu_bo}`} onClick={this.display}>
        <svg className="svg" viewBox="0 0 24 24" preserveAspectRatio="xMidYMid meet"><g><path d="M12 8c1.1 0 2-.9 2-2s-.9-2-2-2-2 .9-2 2 .9 2 2 2zm0 2c-1.1 0-2 .9-2 2s.9 2 2 2 2-.9 2-2-.9-2-2-2zm0 6c-1.1 0-2 .9-2 2s.9 2 2 2 2-.9 2-2-.9-2-2-2z" /></g></svg>
      </playerbutton>

      <div className={`${mdm.dropdown_container} ${this.state.menuShown ? mdm.display : ''}`}>
        <div className={mdm.dropdown_list}>
          <div>
            {this.renderMenuShown()}
          </div>
        </div>
      </div>
      <div hidden>
        {
        this.props.grapped.name// eslint-disable-line
      }
      </div>
    </section>);
  }
}

class MiniplayerDropmenu extends Component { // eslint-disable-line

  render() {
    const { actions, volume } = this.props; // eslint-disable-line
    const options = [{
      name: 'Always on top',
      checkbox: !!1,
    }, {
      name: 'Visualization',
      checkbox: !!1,
    }];

    // Render Dropdown and share its actions
    return (
      <Dropdown menu={options} grapped={options[0]} actions={actions} volume={volume} />
    );
  }
}

export default MiniplayerDropmenu;
